import React, { useState } from "react";
import Form from "./Form";

const App = () => {
  const [todos, setTodos] = useState([]);

  const addValue = (userValue) => {
    if (userValue) {
      const newItem = {
        id: Math.random().toString(36).substring(2.9),
        value: userValue
      }
      console.log(newItem);
      setTodos([...todos, newItem])
    }
  }

  return (
    <div className="App">
    <h1>commit: {todos.length}</h1>
    <Form 
    addValue={addValue}

    />


    </div>
  )
}

export default App ;
